import React, { Component } from 'react';

import Card from 'react-bootstrap/Card'

class PlayerCard extends Component {
    render() {
        return (
          <Card style={{ width: '18rem'}}>
            <Card.Body>
                <Card.Title>{props.players.map(p => <li key={p.id}>{p.name}</li>)}</Card.Title>
                <Card.Text>Player Type: {props.players.map(p => <li key={p.id}>{p.player_type}</li>)}</Card.Text>
                <Card.Text>Cost: {props.players.map(p => <li key={p.id}>{p.cost}</li>)}</Card.Text>
                <Card.Text>Movement Allowance: {props.players.map(p => <li key={p.id}>{p.movement_allowance}</li>)}</Card.Text>
                <Card.Text>Strength: {props.players.map(p => <li key={p.id}>{p.strength}</li>)}</Card.Text>
                <Card.Text>Agility: {props.players.map(p => <li key={p.id}>{p.agility}</li>)}</Card.Text>
                <Card.Text>Armour Value: {props.players.map(p => <li key={p.id}>{p.armour_value}</li>)}</Card.Text>
                <Card.Text>Skills: {props.players.map(p => <li key={p.id}>{p.skills}</li>)}</Card.Text>
            </Card.Body>
        </Card>
        )
    }
}

